        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (34,'52','현명한','1차','기타','지력이 높은 사람을 현명하다고 한다. 현명해 지도록 노력하자!','지력이 200을 넘었다.','지력 200을 넘은 상태에서 레벨업 또는 나이를 먹는다. 단 변신은 포함되지 않는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (35,'53','강한','1차','기타','체력이 높은 사람을 강하다고 한다. 강해지기 위해서는 수련뿐!','체력이 200을 넘었다.','체력 200을 넘은상태에서 레벨업 또는 나이를 먹는다. 단 변신은 포함되지 않는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (36,'54','솜씨 좋은','1차','기타','솜씨가 높은 사람은 손재주가 좋다. 솜씨 좋은 사람은 꼼꼼한 일을 좀 더 잘 할 것이다.','솜씨가 200을 넘었다.','솜씨 200을 넘은상태에서 레벨업 또는 나이를 먹는다. 단 변신은 포함되지 않는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (37,'55','노련한','1차','기타','혼자서 라비 던전을 노미스로 클리어한 노련한 전사에게 주어지는 타이틀','혼자서 라비 던전을 노미스로 클리어한 노련한 전사에게 주어지는 타이틀','황금 달걀을 들고 라비 하급 던전을 혼자서 넘어지지 않고 클리어 한다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (38,'57','몸빵','1차','기타','파티플레이에서는 마법사나 궁수가 스킬을 시전하는 동안 몬스터의 공격을 대신해서 맞아줄 사람이 필요하다. 당신은 남을 위해서 자신을 희생할 수 있는가?','파티플레이중 다른 사람을 대신해서 적의 공격을 온몸으로 맞아주는 당신에게 드리는 타이틀','4인 이상의 파티에서, 다른 플레이어와 전투 중인 몬스터에게 공격받아 죽었을 경우 획득.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (39,'58','럭셔리한','1차','기타','자신이 고가의 장비를 착용하고 있다고 생각한다면, 이 타이틀을 달 수 있을지 도전해보자.','고가의 옷으로 자신을 어필하는 럭셔리한 당신. 도둑을 만날까봐 무섭진 않나요?','악세사리를 제외하고 장비한 아이템이 상점판매가 50만골드가 넘는 상태로 시몬과 개인적인 대화를 한다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (40,'59','헝그리한','1차','기타','배고프고 옷도 다 헤지고, 돈도 없다. 이 타이틀을 따면 구걸하는데 도움이 될까?','배고프고 옷도 다 헤지고, 돈도 없다. 누가 밥 좀 주세요..','배고픔 게이지 50% 와 현재 내구력이 0 인 초보자용 스커트(바지)를 입고 시몬과 개인적인 대화를 한다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (41,'60','겨울소년','1차','기타','겨울 이벤트 참여를 기념하는 타이틀이다.','겨울 이벤트 참여를 기념하는 타이틀이다.','2007년 아이스소드 겨울 이벤트 때 아이스 소드를 제작한다. / 2011년 동계 올림픽 겨울 이벤트를 모두 참가한다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (42,'62','즐거운 설날','1차','기타','즐거운 설날을 기념하는 타이틀이다.','즐거운 설날을 기념하는 타이틀이다.','설날 이벤트에 참가해 본다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (43,'65','현상범 사냥꾼','1차','기타','현상범들을 재빠르게 추격해보자.','교역품을 훔치는 현상범을 멋지게 소탕하였다.','마을에 있는 아무 교역소의 우측에 현상범 게시판에서 현상범을 추적 한다. 추적모드로 들어가고 마을 주변이나 길을 가다보면 약탈단과 마주치게 된다. (베테랑, 일류 약탈탄이 뜨게 되니 초보자는 이 타이틀을 따려고 무리 하지 말자.) 약탈단을 처리하면 낮은 확률로 [현상범의 낭만농장 티켓]이 드랍되며 이것을 사용하면 현상범의 농장으로 갈 수 있다. 비어있는 농장과 매우 낮은 확률로 현상범이 있는 농장으로 가게 되는데 현상범을 잡게 되면 타이틀을 획득 할 수 있다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (44,'68','라노의 탐험가','1차','기타','라노 지역의 지면에 그려진 그림에 대해 좀 더 알아보자.','라노 지역의 지면에 그려진 그림을 모두 알게되었을 때 주어지는 타이틀','라노지역에 존재 하는 모든 문양들을 한번씩 방문한다')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (45,'69','콘누스의 탐험가','1차','기타','콘누스 지역의 지면에 그려진 그림에 대해 좀 더 알아보자.','콘누스 지역의 지면에 그려진 그림을 모두 알게되었을 때 주어지는 타이틀','콘누스지역에 존재 하는 모든 문양들을 한번씩 방문한다')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (46,'70','피시스의 탐험가','1차','기타','피시스 지역의 지면에 그려진 그림에 대해 좀 더 알아보자.','피시스 지역의 지면에 그려진 그림을 모두 알게되었을 때 주어지는 타이틀','피시스지역에 존재 하는 모든 문양들을 한번씩 방문한다')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (47,'71','쿠르클레의 탐험가','1차','기타','쿠르클레 지역의 지면에 그려진 그림에 대해 좀 더 알아보자.','쿠르클레 지역의 지면에 그려진 그림을 모두 알게되었을 때 주어지는 타이틀','쿠르클레지역에 존재 하는 모든 문양들을 한번씩 방문한다')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (48,'72','자르딘의 탐험가','1차','기타','자르딘 지역의 마나 터널에 대해 좀 더 알아보자.','자르딘 지역의 마나 터널을 모두 알게되었을 때 주어지는 타이틀.','자르딘의 레네스 마나 터널을 제외한 나머지 마나터널을 한번씩 사용해본다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (49,'73','그림자를 밝힌','1차','기타','그림자 미션에 대해 더 알아보자.','그림자 미션을 연속으로 여러 번 체험할 때 주어지는 타이틀.','그림자 미션을 연속으로 4번 클리어 한다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (50,'74','그림자 원정대','1차','기타','왕성의 그림자 세계를 조사해보면 무언가 알 수 있을지도 모른다.','타라 왕성 그림자 미션을 경험하면 얻을 수 있는 타이틀','타라의 그림자 미션을 클리어 한다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (51,'75','10살에 노를 잡은','1차','기타','10살에 노를 잡으면 얻을 수 있다.','어린 나이에 노를 잡은 걸 보면 아무래도 이쪽 일에 천부적인 소질이 있어 보인다.','캐릭터 나이 10살일때 쿠르클레 땟목을 타서 노를 잡아본다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (52,'76','10살에 레벨 50이 되다','1차','기타','11살이 되기 전에, 레벨 50까지 포기하지 않고 달려 보자.','10살에 레벨 50을 달성한 사람에게 주어지는 타이틀.','캐릭터 나이 10살에 레벨 50이 된다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (53,'77','17살에 여우에게 지다','1차','기타','10살에 곰을 잡은 사람이 있는가 하면, 17살이 되어도 여우에게 지는 사람도 있다. 좀 더 자신을 보호하도록 하자.','17살이 되어서 여우에게 진 사람에게 붙는 굴욕적인 타이틀.','캐릭터 나이 17살에 여우에게 죽는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (54,'78','10살에 곰을 잡을 뻔 했다','1차','기타','10살에 곰을 쓰러뜨릴뻔 했으나...','10살에 곰을 잡을 뻔 했으나, 한 살을 더 먹어버렸다.','11살에 곰을 잡는다. 여담이지만 12살 이상부터는 딸 수 없다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (55,'79','맨손으로 곰을 잡다','1차','기타','곰을 맨손으로 쓰러뜨리는 것은 무도를 익히는 사람이라면 한번쯤 꿈꿔보는 일이 아닌가? 하지만 상당히 무모한 일임에는 틀림없을 것이다.','맨 손으로 곰을 잡은 적이 있다는 표시. 하지만 이 타이틀은 당신의 무모함을 표현하기도 한다.','맨손으로 곰을 잡는다. 보조무기에도 무기가 장착되어 있으면 안된다. 파티원이 본인 포함 2명이 있는 상태에서, 파티의 피니시 규칙을 파티원중 누구라도로 바꾼 후에 곰을 아무렇게나 때려잡으면 곰에게 finish 표시가 뜬다. 이 상태에서 맨손으로 곰을 톡 하고 치면 타이틀을 획득할 수 있다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (56,'80','10살에 곰을 잡다','1차','기타','10살에 곰을 쓰러뜨리면 얻을 수 있다.','10살의 그 약한 몸으로 곰을 쓰러뜨리다니. 이것은 신체의 힘을 극복한 지혜의 상징이다.','10살에 곰을 잡는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (57,'81','한 방에 곰을 잡다','1차','기타','한방에 곰을 쓰러뜨린 사람에게 주어지는 타이틀. 당신은 곰을 한방으로 쓰러뜨릴수 있을것인가!?','곰은 더이상 내 적수가 아니다! 한방이면 충분하다!','체력이 꽊찬 곰을 한방에 잡는다. 갈색곰이나 새끼 갈색 그리즐리 베어가 그나마 체력이 낮으니 (약 300) 노려보자. 만약 자장가 1랭인 음유시인이 자장가를 곰에게 걸어주면 무조건 트루대미지 300 이 추가되므로 매우 따기 쉬워진다. 이 타이틀은 체력이 상당히 많이 오르므로 전사에게 유용한 타이틀이다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (58,'82','한 방에 골렘을 잡다','1차','기타','한방에 골렘을 쓰러뜨린 사람에게 주어지는 타이틀. 과연 이 경지에 오를 수 있을것인가?','골렘조차도 더이상 내 적수가 아니다.','한방에 골렘을 잡는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (59,'83','골렘을 잡다','1차','기타','골렘을 쓰러뜨리면 얻을 수 있는 칭호','골렘을 쓰러뜨렸다','골렘을 잡는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (60,'84','서큐버스를 잡다','1차','기타','서큐버스를 쓰러뜨리면 얻을 수 있는 칭호','서큐버스를 쓰러뜨렸다','서큐버스를 잡는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (61,'85','오거를 잡다','1차','기타','오거를 쓰러뜨리면 얻을 수 있는 칭호','오거를 쓰러뜨렸다','오거를 잡는다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (62,'86','세이렌의 가면을 벗긴','1차','기타','특정 기술로 세이렌을 쓰러뜨리면, 세이렌의 또 다른 모습을 드러낼 수 있다.','두 개의 얼굴을 가진 세이렌의 정체를 밝혀냈다.','룬다 세이렌 던전의 세이렌의 가면을 벗긴다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (63,'87','서큐버스를 유혹한','1차','기타','서큐버스에게 유혹을 시도하면 알게 된다. 서큐버스에게 그런 생각을 품다니, 당신은 바람둥이?','서큐버스를 유혹하였다.','서큐버스를 조련 or 컨트롤 오브 다크니스 or 현혹의 연주로 조련에 성공한다.')");
        paramSQLiteDatabase.execSQL("INSERT INTO TITLEFIRST ( titleId, titleNumber, titleName, titleKind, titleCategory, beforeComment, afterComment, howGet ) VALUES (64,'88','불화살','1차','기타','불화살은 궁수의 로망! 불화살의 달인에게 주어지는 명예로운 타이틀','불화살은 궁수의 로망! 불화살의 달인에게 주어지는 명예로운 타이틀','캠프파이어 근처에서 활을 이용하여 동급 이상 몬스터를 크리티컬로 잡는다.')");
